import React from 'react';

const About = () => {
  return (
    <div className="section about-section">
      <h2>About Me</h2>
      <div className="about-content">
        <p>Passionate data analyst with a unique background in DevOps, bringing a comprehensive understanding of both data insights and infrastructure automation.</p>
        <p>Currently leveraging analytical skills to transform complex datasets into actionable business intelligence, while preparing for a strategic return to DevOps with enhanced data expertise.</p>
      </div>
    </div>
  );
};

export default About;
